import React from 'react';
import { Wifi, WifiOff, Bell, Settings } from 'lucide-react';

const Header = ({ isConnected }) => {
  return (
    <header className="bg-white shadow-sm border-b border-gray-200">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center h-16">
          {/* Logo and Title */}
          <div className="flex items-center">
            <div className="flex-shrink-0">
              {/* Sentinel Logo */}
              <div className="flex items-center">
                <div className="w-10 h-10 mr-3">
                  <svg viewBox="0 0 40 40" className="w-full h-full">
                    {/* Background */}
                    <rect width="40" height="40" fill="black"/>

                    {/* Crown - Left half (yellow) */}
                    <rect x="8" y="4" width="12" height="8" fill="#FFD700"/>
                    <rect x="10" y="2" width="2" height="2" fill="#FFD700"/>
                    <rect x="14" y="2" width="2" height="2" fill="#FFD700"/>
                    <rect x="18" y="2" width="2" height="2" fill="#FFD700"/>

                    {/* Crown - Right half (gold/beige) */}
                    <rect x="20" y="4" width="12" height="8" fill="#F4A460"/>
                    <rect x="22" y="2" width="2" height="2" fill="#F4A460"/>
                    <rect x="26" y="2" width="2" height="2" fill="#F4A460"/>
                    <rect x="30" y="2" width="2" height="2" fill="#F4A460"/>

                    {/* Face - Dark trapezoid */}
                    <polygon points="8,12 32,12 28,32 12,32" fill="#2C2C2C"/>

                    {/* Left eye - White triangle */}
                    <polygon points="12,18 16,18 14,22" fill="white"/>

                    {/* Right eye - Red triangle */}
                    <polygon points="24,18 28,18 26,22" fill="#FF0000"/>
                  </svg>
                </div>
                <div>
                  <h1 className="text-2xl font-bold text-gray-900">
                    Sentinel
                  </h1>
                  <p className="text-sm text-gray-500">Risk Management System</p>
                </div>
              </div>
            </div>
          </div>

          {/* Connection Status and Actions */}
          <div className="flex items-center space-x-4">
            {/* Connection Status */}
            <div className="flex items-center space-x-2">
              {isConnected ? (
                <>
                  <Wifi className="h-5 w-5 text-green-500" />
                  <span className="text-sm text-green-600">Connected</span>
                </>
              ) : (
                <>
                  <WifiOff className="h-5 w-5 text-red-500" />
                  <span className="text-sm text-red-600">Disconnected</span>
                </>
              )}
            </div>

            {/* Notifications */}
            <button className="p-2 text-gray-400 hover:text-gray-500">
              <Bell className="h-5 w-5" />
            </button>

            {/* Settings */}
            <button className="p-2 text-gray-400 hover:text-gray-500">
              <Settings className="h-5 w-5" />
            </button>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
